if (!!navigator.platform && /iPad|iPhone|iPod/.test(navigator.platform)) {
    var inlineVideos = document.querySelectorAll('.inline-video');
    [].forEach.call(inlineVideos, function(el) {
        var placeholderImg = el.querySelector('.inline-video__play-wrapper');
        placeholderImg.addEventListener('click', function() {
            var playButton = el.querySelector('.inline-video__play');
            var videoEl = el.querySelector('video');

            var videoParent = videoEl.parentElement;
            if (!videoParent.classList.contains('inline-video__video')) {
                return;
            }

            // hide play button
            playButton.classList.add('inline-video__play--hidden');
            placeholderImg.classList.add('inline-video__placeholder--hidden');
            // fade in + play the video
            videoParent.classList.add('inline-video__video--visible');
            videoEl.play();
        });
    });
}
